// Modifica y retorna el objeto original con un nuevo query construido elegantemente
return (() => {
  // Obtener el objeto original
  const webhookData = $node["Webhook"]?.json?.body || {};

  // Extraer y procesar el mensaje
  const [,, userMsg] = (webhookData.query || "").split("|").concat([null, null, "Te comparto mi curriculum"]);
  const { webViewLink: cvLink } = $input.first()?.json || {};

  // Modificar el objeto original con los datos procesados
  return {
    ...webhookData,
    query: `${userMsg.trim()}|${cvLink || "Enlace no disponible"}`
  };
})();

let result = [];

for (const item of $input.all()) {
  for (const msg of item.json.messages) {
    const parsedMsg = JSON.parse(msg);  // Parseamos el mensaje JSON
    const attachmentId = parsedMsg.messageType === 'documentMessage' ? parsedMsg.messageId : null;

    // Buscamos si ya existe una entrada para este remoteJid en el resultado
    let entry = result.find(r => r.remotejid === parsedMsg.remoteJid);

    if (entry) {
      // Si el messageType es 'documentMessage', actualizamos el attachmentid
      if (parsedMsg.messageType === 'documentMessage' && !entry.attachmentid) {
        entry.attachmentid = parsedMsg.messageId;
      }
      // Acumulamos el mensaje en la cadena separada por '|'
      entry.messages += (entry.messages ? '|' : '') + parsedMsg.message;
    } else {
      // Si no existe, creamos una nueva entrada
      result.push({
        remotejid: parsedMsg.remoteJid,
        pushname: parsedMsg.pushName,
        messages: parsedMsg.message,  // Empezamos con el primer mensaje
        attachmentid: attachmentId,
        instance: parsedMsg.instance,
      });
    }
  }
}

return result;
